import React from 'react';
import { useNavigate } from 'react-router-dom'; // Hook for navigation
import './NursePage.css'; // Import NursePage CSS for styling

const NursePage = () => {
  const navigate = useNavigate(); // Initialize navigation

  // Handle button click to navigate to specific form
  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div className="nurse-page">
      <h1>Nurse Page</h1>
      <div className="form-options">
        <button onClick={() => handleNavigation('/surveillance-form')}>Patient Administration Details</button>
        <button onClick={() => handleNavigation('/surgery-form')}>Patient Surgery Details</button>
        <button onClick={() => handleNavigation('/antibiotic-form')}>Patient Antibiotic Details</button>
        <button onClick={() => handleNavigation('/microbiology-form')}>Patient Microbiology Details</button>
        <button onClick={() => handleNavigation('/event-details-form')}>Patient Event Details</button> {/* Added button */}
      </div>
    </div>
  );
};

export default NursePage;
